import React from "react";
import Button from '@material-ui/core/Button';

const Plus = () => {

  let [value , mewValue] = useState(0);

  return(
    <>
      <div className = "center_div">
        <h1>{value}</h1>
        <Button variant="contained" >Default</Button>
        <Button variant="contained" >+</Button>
        
      </div>
    </>
  );
}
export default Plus;
